import React from 'react';
import './index.scss'


class RightSlide extends React.Component {

    render() {
        return (
            <div className='RightSlide'>
                <ul>
                    <li>item 1</li>
                    <li>item 2</li>
                    <li>item 3</li>
                </ul>
            </div>
        )
    }

}

export default RightSlide;
